package fills.main.common;



import javax.swing.ImageIcon;
import javax.swing.JFrame;

import fills.tools.image.ImageUtil;



/**
 * 
 * @ClassName: JFrameMain.java
 * @Description: 封装窗口面板属性
 * @author: ysf
 * @date: 2021年3月20日 下午2:44:43 
 *
 * Modification History:
 * Date         Author         Description
 * 2021年3月20日      ysf            封装窗口面板属性
 */
public class JFrameMain {
	//copy2paste logo
	public static String imageBase64 ="";
	//common logo
	public static String commonBase64 ="";
	
	/**
	 * 
	 * @Function: JFrameMain.java
	 * @Description: 创建会话窗口
	 *
	 * @param: title
	 * @param: name
	 * @param: width
	 * @param: height
	 * @param:@return
	 * @return：JFrame
	 *
	 * @author: ysf
	 * @date: 2021年3月12日 上午10:11:57 
	 *
	 * Modification History:
	 * Date         Author      Description
	 * 2021年3月12日      ysf         创建会话窗口
	 */
    public static JFrame getJFrame(String title,String name,int width,int height){
    	JFrame jFrame = new JFrame(title);
    	jFrame.setSize(width, height);
    	jFrame.setName(name);
    	jFrame.setLocationRelativeTo(null);//居中
    	return jFrame;
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 设置窗口标题
     *
     * @param: jFrame
     * @param: title
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月20日 下午5:12:42 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月20日      ysf         设置窗口标题
     */
    public static void setTitle(JFrame jFrame,String title){
    	jFrame.setTitle(title);
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 设置logo
     *
     * @param: jFrame
     * @param: imageBase64
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月12日 上午10:12:23 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月12日      ysf         设置logo
     */
    public static void setLogo(JFrame jFrame,String imageBase64){
    	jFrame.setIconImage(ImageUtil.base642Image(imageBase64));
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 设置logo
     *
     * @param: jFrame
     * @param: imageBase64
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月12日 上午10:12:23 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月12日      ysf         设置logo
     */
    public static void setLogo(JFrame jFrame){
    	jFrame.setIconImage(ImageUtil.base642Image(imageBase64));
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 去掉窗口装饰
     *
     * @param: jFrame
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月20日 下午2:14:11 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月20日      ysf         去掉窗口装饰
     */
    public static void setUndecorated(JFrame jFrame){
    	jFrame.setUndecorated(true);
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 设置窗口风格 0-原型，1-基础装饰，2-简单对话框风格，3-信息对话框风格，4-错误会话框，6-文件选择器会话   
     *
     * @param: jFrame
     * @param: sytle
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月20日 下午2:19:13 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月20日      ysf         设置窗口风格
     */
    public static void setWindowsStyle(JFrame jFrame,int sytle){
    	jFrame.getRootPane().setWindowDecorationStyle(sytle);
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 禁止拉伸大小
     *
     * @param: jFrame
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月20日 下午2:39:29 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月20日      ysf         禁止拉伸大小
     */
    public static void setResizable(JFrame jFrame){
    	jFrame.setResizable(false);
    }
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 窗口置顶
     *
     * @param: jFrame
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月20日 下午2:41:11 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月20日      ysf         窗口置顶
     */
    public static void setAlwaysOnTop(JFrame jFrame){
    	jFrame.setAlwaysOnTop(true);
    }
    
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 显示窗口
     *
     * @param: jFrame
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月12日 上午10:12:53 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月12日      ysf         显示窗口
     */
    public static void show(JFrame jFrame){
    	if(!jFrame.isVisible()){
    		jFrame.validate();
    		jFrame.setVisible(true);
    	}
    }
    
    /**
     * 
     * @Function: JFrameMain.java
     * @Description: 隐藏窗口
     *
     * @param: jFrame
     * @return：void
     *
     * @author: ysf
     * @date: 2021年3月20日 下午3:18:24 
     *
     * Modification History:
     * Date         Author      Description
     * 2021年3月20日      ysf         隐藏窗口
     */
    public static void hide(JFrame jFrame){
    	if(jFrame.isVisible()){
    		jFrame.setVisible(false);
    	}
    }
    
    public static void main(String[] args) {
    	System.out.println(ImageUtil.image2Base64(new ImageIcon("D:/common.png").getImage()));
	}
    
    
}
